import React, { Component } from 'react';
import { InfoConsumer } from '../context';

class Details extends Component {
    render() {
        return (
            <InfoConsumer>
                {data => {
                    const {
                        id,
                        headerTitle,
                        headerSubTitle,
                        headerText,
                        img,
                        title,
                        maps,
                        description
                    } = data.detailInfo;

                    return (
                        <React.Fragment>
                            <div className="container-fluid align-items-center"></div>
                        </React.Fragment>
                    )
                }

                }
            </InfoConsumer>
        )
    }
}

export default Details;
